dnaSeq = ""

curNum = 0
curMin = 0
curMinPos = []

for i in range(len(dnaSeq)):
    if dnaSeq[i] == 'C':
        curNum -= 1
    elif dnaSeq[i] == 'G':
        curNum += 1

    if curNum == curMin:
        curMinPos.append(i + 1)
    elif curNum < curMin:
        curMin = curNum
        curMinPos = []
        curMinPos.append(i + 1)


